const {concat} = require(`./concat`);
const {insert} = require(`./insert`);
const {update} = require(`./update`);
const {values} = require(`./values`);
const {sets} = require(`./sets`);

module.exports = {
    concat,
    insert,
    update,
    values,
    sets
};
